  false,\n\t\"url\": null,\n\t\"notes\": \"In an effort to detect spatial and temporal
  changes in the structure of the coral reef community, coral coverage and reef fish
  density and diversity were documented at selected sites along the Maui coastline
  using standard transect methodology and SCUBA. Physical parameters examined included:
  wave exposure, water motion, sedimentation levels and water quality (temperature,
  salinity, and turbidity). Nine long-term monitoring sites have been established
  since 1989.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
